te verlaten. Ze worden van hun wortels losgerukt en gaan op weg. Het onbekende tegemoet. Davut Altun wil zo snel 

mogelijk met zijn gezin naar Noorwegen, al moet dat op illegale wijze, en de weg van Haydar Altun en zijn gezin 

leidt naar Istanbul. De reis is begonnen...

